import pandas as pd
import re

def clean_camera(camera_string):
    """Extracts the MP value from a camera string."""
    if isinstance(camera_string, str):
        match = re.search(r'(\d+)MP', camera_string)
        if match:
            return int(match.group(1))
        else:
            return 0
    else:
        return 0

